import React from 'react';
import Title from 'antd/lib/skeleton/Title';
import AppLayout from '../components/AppLayout';

const Profile = () => {
    return (
       <>
       <Head>
           <Title>내 프로필 | NodeBird</Title>
       </Head>
       <AppLayout>내 프로필</AppLayout>
       </> 
    )
}

export default Profile;
